    uint256 private _previousBuyFee = TaxBuyCoin_; 
    uint256 private _previousSellFee = _sellFee; 
    uint256 public maxWalletCoin_ = _tTotal.mul(1).div(100);
    uint256 private _previousMaxWalletToken = maxWalletCoin_;
    uint256 public maxTxCoin_ = _tTotal.mul(1).div(100); 
    uint256 private _previousMaxTxAmount = maxTxCoin_;
    address payable public Address_creator = payable(0xb5af6Ec45aaFDDEcd0cCa7C1faB72919ACBd2341);
    address payable public BurnAddress_ = payable(0x000000000000000000000000000000000000dEaD); 
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    bool public inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;

    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity

    );


    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }



    constructor () {
        _tOwned[owner()] = _tTotal;

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x20DD97c68AfB5D44A28AB41081035cd500aC3AcC); 


        // Create pair address for PancakeSwap
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;
        _ExcludeFromTax[owner()] = true;
        _ExcludeFromTax[address(this)] = true;
        _ExcludeFromTax[Address_creator] = true;

        emit Transfer(address(0), owner(), _tTotal);
    }


    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _tOwned[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }



    function excludeTax_(address account) public onlyOwner {
        _ExcludeFromTax[account] = true;
    }

    // Set a wallet address so that it has to pay transaction fees
    function includeTax_(address account) public onlyOwner {
        _ExcludeFromTax[account] = false;
    }




    function _taxSet(uint256 _taxBuy, uint256 _taxSell) external onlyOwner() {

        require((_taxBuy + _taxSell) <= maxPossibleFee, "Fee is too high!");
        _sellFee = _taxSell;
        TaxBuyCoin_ = _taxBuy;

    }

    function WalletUpdate_(address payable wallet) public onlyOwner() {
        Address_creator = wallet;
        _ExcludeFromTax[Address_creator] = true;
    }



    function set_Swap_And_Liquify_Enabled(bool true_or_false) public onlyOwner {
        swapAndLiquifyEnabled = true_or_false;
        emit SwapAndLiquifyEnabledUpdated(true_or_false);
    }

    function set_Number_Of_Transactions_Before_Liquify_Trigger(uint8 number_of_transactions) public onlyOwner {
        swapTrigger = number_of_transactions;
    }


    receive() external payable {}


    bool public noTaxTransfer_ = false;


    function noFee_Set(bool true_or_false) external onlyOwner {
        noTaxTransfer_ = true_or_false;
    }


    function SetMax_buy(uint256 maxTxPercent_x100) external onlyOwner() {
        maxTxCoin_ = _tTotal*maxTxPercent_x100/10000;
    }    

     function setMax_Wallet(uint256 maxWallPercent_x100) external onlyOwner() {
        maxWalletCoin_ = _tTotal*maxWallPercent_x100/10000;
    }

    function removeAllFee() private {
        if(_TotalFee == 0 && TaxBuyCoin_ == 0 && _sellFee == 0) return;


        _previousBuyFee = TaxBuyCoin_; 
        _previousSellFee = _sellFee; 
        _previousTotalFee = _TotalFee;
        TaxBuyCoin_ = 0;
        _sellFee = 0;
        _TotalFee = 0;

    }

    function restoreAllFee() private {

    _TotalFee = _previousTotalFee;
    TaxBuyCoin_ = _previousBuyFee; 
    _sellFee = _previousSellFee; 

    }


    function _approve(address owner, address spender, uint256 amount) private {

        require(owner != address(0) && spender != address(0), "ERR: zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);

    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {



        if (to != owner() &&
            to != Address_creator &&
            to != address(this) &&
            to != uniswapV2Pair &&
            to != BurnAddress_ &&
            from != owner()){
            uint256 heldTokens = balanceOf(to);
            require((heldTokens + amount) <= maxWalletCoin_,"You are trying to buy too many tokens. You have reached the limit for one wallet.");}



        if (from != owner() && to != owner())
            require(amount <= maxTxCoin_, "You are trying to buy VNC coin than the max transaction limit.");





        if(
            txCount >= swapTrigger && 
            !inSwapAndLiquify &&
            from != uniswapV2Pair &&
            swapAndLiquifyEnabled 
            )
        {  

            txCount = 0;
            uint256 contractTokenBalance = balanceOf(address(this));
            if(contractTokenBalance > maxTxCoin_) {contractTokenBalance = maxTxCoin_;}
            if(contractTokenBalance > 0){
            swapAndLiquify(contractTokenBalance);
        }
        }


        bool takeFee = true;

        if(_ExcludeFromTax[from] || _ExcludeFromTax[to] || (noTaxTransfer_ && from != uniswapV2Pair && to != uniswapV2Pair)){
            takeFee = false;
        } else if (from == uniswapV2Pair){_TotalFee = TaxBuyCoin_;} else if (to == uniswapV2Pair){_TotalFee = _sellFee;}

        _tokenTransfer(from,to,amount,takeFee);
    }


    function sendToWallet(address payable wallet, uint256 amount) private {
            wallet.transfer(amount);
        }


    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {

        swapTokensForBNB(contractTokenBalance);
        uint256 contractBNB = address(this).balance;
        sendToWallet(Address_creator,contractBNB);
    }


    function processTokens_ (uint256 percent_To_Process) public onlyOwner {
        require(!inSwapAndLiquify, "Currently processing, try later."); 
        if (percent_To_Process > 100){percent_To_Process == 100;}
        uint256 tokensOnContract = balanceOf(address(this));
        uint256 sendTokens = tokensOnContract*percent_To_Process/100;
        swapAndLiquify(sendTokens);
    }


    function swapTokensForBNB(uint256 tokenAmount) private {

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            address(this),
            block.timestamp
        );
    }


    function set_New_Router_and_Make_Pair(address newRouter) public onlyOwner() {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Pair = IUniswapV2Factory(_newPCSRouter.factory()).createPair(address(this), _newPCSRouter.WETH());
        uniswapV2Router = _newPCSRouter;
    }

    function set_New_Router_Address(address newRouter) public onlyOwner() {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Router = _newPCSRouter;
    }


    function set_New_Pair_Address(address newPair) public onlyOwner() {
        uniswapV2Pair = newPair;
    }


    function _tokenTransfer(address sender, address recipient, uint256 amount,bool takeFee) private {


        if(!takeFee){
            removeAllFee();
            } else {
                txCount++;
            }
            _transferTokens(sender, recipient, amount);

        if(!takeFee)
            restoreAllFee();
    }


    function _transferTokens(address sender, address recipient, uint256 tAmount) private {
        (uint256 tTransferAmount, uint256 tDev) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _tOwned[address(this)] = _tOwned[address(this)].add(tDev);   
        emit Transfer(sender, recipient, tTransferAmount);
    }


    function _getValues(uint256 tAmount) private view returns (uint256, uint256) {
        uint256 tDev = tAmount*_TotalFee/100;
        uint256 tTransferAmount = tAmount.sub(tDev);
        return (tTransferAmount, tDev);
    }

}
